import './header.css'
import history from '../history'

export default function Header(props) {
    const logout = () => {
        props.setToken(null)
        history.push('/login')
    }

    const profile = () => {
        if (history.location.pathname.startsWith('/customer')) {
            history.push('/customer/profile')
            console.log(123)
        }
        // if (history.location.pathname.startsWith('/company')) { history.push('/company/profile') }
        // if (history.location.pathname.startsWith('/admin')) { history.push('/admin/profile') }
    }

    return (<div className='Header'>
        <div className='Header-button-div'>
            <button className='Header-profile' onClick={() => profile()}>Profile</button>
            <button className='Header-logout' onClick={() => logout()}>Logout</button>
        </div>
    </div>)
}
